import React from 'react';

import styles from './StartLight.module.scss';

function StartLight() {

   return (
      <div className = { styles.startLight }>
         <div className = { styles.light }/>
         <div className = { styles.light }/>
         <div className = { styles.light }/>
         <div className = { styles.foot }/>
      </div>
   )
}

export default StartLight;
